import { GET_FOODS, ADD_FOOD } from "../actions/types";

const initialState = {
	foods: [
		{ name: "White Glazed with Sprinkles", img: "glazed_donut" },
		{ name: "donuts", img: "donuts_img" },
	],
};

export default function (state = initialState, action) {
	switch (action.type) {
		case GET_FOODS:
			return {
				...state,
			};
		default:
			return state;
	}
}
